const CACHE_NAME="gosbank-v0.3",filesToCache=["/offline","/style.min.css","/script.min.js","/logo.png","/anthem.m4a"];self.addEventListener("install",function(e){e.waitUntil(caches.open(CACHE_NAME).then(function(e){return e.addAll(filesToCache)}))}),self.addEventListener("activate",function(e){e.waitUntil(caches.keys().then(function(e){return Promise.all(e.filter(function(e){return e!=CACHE_NAME}).map(function(e){return caches.delete(e)}))}))}),self.addEventListener("fetch",e=>{e.respondWith(caches.match(e.request).then(function(n){return n||fetch(e.request).catch(function(){return caches.match("/offline")})}))});